  \"2015-01-22T15:57:23.638150\",\n\t\"name\": \"assisted-housing-low-income-housing-tax-credits\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Low-Income Housing Tax Credit (LIHTC)
  is the primary Federal program for creating affordable housing in the United States.
  The LIHTC database, created by HUD and available to the public since 1997, contains
  information on 33,777 projects and almost 2,203,000 housing units placed in service
  between 1987 and 2010. Created by the Tax Reform Act of 1986, the LIHTC program
  gives State and local LIHTC-allocating agencies the equivalent of nearly $8 billion
  in annual budget authority to issue tax credits for the acquisition, rehabilitation,
  or new construction of rental housing targeted to lower-income households. Although
  some data about the program have been made available by various sources, HUD's database
  is the only complete national source of information on the size, unit mix, and location
  of individual projects. With the continued support of the national LIHTC database,
  HUD hopes to enable researchers to learn more about the effects of the tax credit
  program. The LIHTC property locations depicted in this map service represent the
  general location of the property. The locations of individual buildings associated
  with each property are not depicted here. The location of the property is derived
  from the address of the building with the most units.\",\n\t\"license_title\": \"License
